import React from 'react'
import {BrowserRouter , Link , Route} from 'react-router-dom'
import Home from './component/Home'

function App() {
  return (
    <div>
      <BrowserRouter>
        <Link to="/">Home</Link>


        <Route path="/" component={Home} />
      </BrowserRouter>
    </div>
  )
}

export default App;
